import Vue from 'vue';
import App from './App.vue';
import store from './store'; // Import Vuex store

Vue.config.productionTip = false;

new Vue({
  store, // Thêm store vào ứng dụng Vue
  render: (h) => h(App),
}).$mount('#app');
